file_enc = 'utf-8'
sys_enc = 'utf-8'



def load_mapping(path):
	cnt = 0
	mappings = {}
	with open(path) as f:
		while 1:
			line = f.readline().rstrip()
			if not line:
				break
			# line is in form of 㔈,7622,驶,奎,驶,孓
			uchars = line.split(',')
			mappings[uchars[0]] = "".join(uchars[2:])
			cnt += 1
	# print('line count=%d' % cnt)
	return mappings


def dump_mapping():
	if inFL:
		comp_info_path = os.path.join(fl.userpath, 'Macros', 'expand', 'comp_info.txt')
	else:
		comp_info_path = 'comp_info.txt'
	mappings = load_mapping(comp_info_path)
	with open(comp_info_path + '.json', 'w') as fp:
		json.dump(mappings, fp)


